import {
	SETUP_CART,
	GET_CART,
} from '../actions/types';


export default function(state={cart_id:null, cart:[]}, action){
	switch(action.type){


	case SETUP_CART:
		return {...state, cart_id:action.payload};

	case GET_CART:
		return {...state, cart:action.payload}


	default:
		return state;
	}
}
